In dorsal view (
Fig. 2A
), body broadly oval, with maximum width at the gills level; snout bluntly rounded. In lateral view (
Fig. 2B
), body depressed dorsoventrally, especially in its rostral part, with a flat dorsum. Eyes lateral, relatively small; pupils oriented laterally. Nostrils closed during mid-larval stages, small darkly pigmented protuberances visible on the snout at their place; nasolacrimal grooves faintly visible. Spiracle ventral, medial, in the form of a tapering tube extending beyond the end of the body and fusing with the vent tube (
Fig. 5A
). Vent tube medial, oblique; vent opening located at the ventral edge of the ventral fin. Tail moderately long (less than twice the body length), lanceolate, with an elongate, narrowly tapering tip. Tail musculature rather weakly developed (tail base nearly a third of the maximal body width). Tail fins relatively tall, reaching their maximum height at the middle third of the tail length. Sheets of slightly thickened skin visible on the sides of the proximal part of the tail (22–25% of tail length), along the muscular part and the bases of the dorsal and ventral fins. Dorsal fin originating slightly posterior to the body-tail junction, nearly equal in height to the ventral fin. Mouth terminal, without keratinized elements. Upper labium widely arched, concave from the dorsal view, with two lateral flaps slightly projecting forwards beyond the snout edge and smoothly curved outwards; lower labium rather narrow, Ω-shaped, with a narrow, smooth, irregularly dentate flange (
Fig. 6A
).
